    "2016-07-27T22:19:38.692776",nt"name": "survey-and-long-term-monitoring-of-small-mammal-populations-on-the-walnut-creek-national-w",nt"isopen":
    false,nt"url": null,nt"notes": "A propose a study of small mammals on the
    Walnut Creek National Wildlife Refuge. There will be two components to this study.
    The first, conducted during the Summer of 1994, will be an intensive survey of small
    mammal diversity. It will be as comprehensive as possible, and include all major
    habitats and a variety of trapping methods. The second component will be a long-term,
    semiannual live-trapping study conducted during Spring and Fall, at times of low
    and high abundance. It will concentrate on the dominant small mammal species, and
    will be coordinated with vegetation sampling. This study offers the unique opportunity
    to obtain base-line data on small mammal populations on the Refuge, and then track
    changes with restoration of the natural prairie  vegetation. This will provide basic
    data on the ecology of small mammals in restored prairies, and also allow Refuge
    staff to make informed decisions on the management of small mammal species.",nt"license_title":
